const captureIdRegex = new RegExp(
  /https:\/\/pokeapi.co\/api\/v2\/pokemon\/([0-9]+)\//
)

export const getId = pokemon => {
  const { url } = pokemon
  const match = captureIdRegex.exec(url)
  if (match.length !== 2) throw Error('unmatch url')
  return match[1]
}
